import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';



function Note() {

    return (
        <>
            <div className="Notes">
                <h1>Tile</h1>
                <br />
                <p>Thsi Content</p>
                <DeleteIcon className="delete" />


            </div>

        </>
    )
}

export default Note;
